USE workcation_db;

DROP TABLE IF EXISTS coworkings;

CREATE TABLE IF NOT EXISTS coworkings(
   cowork_id INT auto_increment PRIMARY KEY
  ,Name      VARCHAR(118) NOT NULL
  ,Address   VARCHAR(200) NOT NULL
  ,City      VARCHAR(33) NOT NULL
  ,Rating    VARCHAR(20) NOT NULL
  ,Website   VARCHAR(173) NOT NULL
  ,Schedule  VARCHAR(575) NOT NULL
  ,Latitude  NUMERIC  NOT NULL
  ,Longitude NUMERIC  NOT NULL
);

ALTER TABLE coworkings
MODIFY Latitude DECIMAL(10,8),
MODIFY Longitude DECIMAL(11,8);

